import React from 'react';
import { Nav } from 'react-bootstrap';
import NavBar from './Nav';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

const Lemmikud = ({ people, isLiked }) => {
    return (
        <div className="container">
            <NavBar />

            <div className="row">
                {isLiked.map((person, index) => (
                    <div className="col-md-4 mb-3" key={index}>
                        <div className="card">
                            <img src={person.picture instanceof File ? URL.createObjectURL(person.picture) : person.picture} className="card-img-top" />
                            <div className="card-body">
                                <h5 className="card-title">{person.name}name</h5>
                                <p className="card-text">Phone: {person.phone}phone</p>
                                <p className="card-text">Education: {person.education}education</p>
                            </div>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}

export default Lemmikud;
